import React from 'react';
import './Content.css';
import logo from '../assets/Logo UNP.png'; // Ruta de la imagen del logo

const Content = () => {
  return (
    <div className="content">
      <div className="opciones-activos">
        <div className="opcion">
          <span>Asignación de Activos</span>
        </div>
        <div className="opcion">
          <span>Solicitud de Activos</span>
        </div>
        <div className="opcion">
          <span>Información de Activos</span>
        </div>
        <div className="opcion">
          <span>Depreciación de Activos</span>
        </div>
      </div>
    </div>
  );
};

export default Content;
